1. 负责项目中数据处理工作(数据采集、清洗、汇总、集成等),保证数据的准确性和稳定性；
2. 负责协助完成应用系统中数据上下层衔接处理工作；
3. 对用户数据进行分析和挖掘，提供决策支持；
4. 大数据数据产品策划，对数据库信息的深度挖掘，充分体现数据的商业价值职位要求。

岗位要求：
1. 精通java或php至少一门编程语言，两种都熟悉优先；
2. 精通shell脚本编程，至少熟悉Python或perl等一门语言;
3. 熟悉HTTP协议;
4. 熟悉Hadoop/Hive/Hbase/Spark/Storm等分布式计算环境进行海量数据分析与计算经验者优先;
5. 做过数据仓库,对数据治理、数据标准及元数据有很好理念及实施经验的优先;
6. 良好的沟通能力和团队精神,具备创新意识；
7. 以结果为导向,具有强烈的责任心、钻研精神和良好的团队沟通能力。

职位描述:
1. 负责公司数据仓库和数据集市系统设计和开发；
2. 建立分析模型，设计报表, 设计展现途径, 支持业务分析需求；
3. OLAP和报表开发、ETL工具研发和维护；
4. 数据仓库系统维护, 监控, 优化等;

职位要求:
1. 熟悉数据仓库建模和常用的数据采集工具;
3. 熟悉hadoop及其家族组件 hive(必须)/kafka/HBase;
2. 熟练编写udf函数, 能使用python/shell/java等编写数据处理脚本;
4. 了解 impala/presto/kylin 者优先;

【岗位职责】
1、构建分布式大数据技术平台;
2、参与和构建公司海量数据存储、离线/实时计算、OLAP 引擎，大数据系统运维等系统;
3、服务各种业务大数据处理需求，服务日益增长的业务计算和数据量;
4、深入源码内核改进优化开源项目，解决各种Hadoop、Spark、Hbase、Flink等疑难问题，参与到开源社区建设和代码贡献。
【职位要求】
1、计算机或相关专业本科以上学历(3年以上工作经验);
2、精通C++/Java/Scala程序开发(至少一种)，熟悉Linux/Unix开发环境;
3、熟悉常用开源分布式系统，精通Hadoop/Hive/Spark/Storm/Flink/HBase之一源代码;
4、有大规模分布式系统开发、维护经验，有故障处理能力，源码级开发能力;
5、对Kudu、Kylin、Impala、Presto，Hbase 等系统有深入使用和底层研究者优化；
6、有责任心，乐于挑战，善于沟通，学习能力强。

岗位描述
1. 完善贝贝指标体系, 并基于业务监控指标体系，及时发现与定位业务问题；
2. 通过专题分析，对业务问题进行深入分析，为业务运营决策提供数据支持； 
3. 沉淀分析思路与框架，提炼数据产品需求，协作并推动数据产品落地；
4. 通过数据分析、数据挖掘，推动数据化运营；




岗位要求
1.数学、计算机、统计学等相关专业本科以上学历，2到3年以上相关工作经历; 
2.熟悉hive sql，熟悉大数据开发环境；

3. 熟练独立编写商业数据分析报告，及时发现和分析其中隐含的变化和问题; 
4. 良好的数据敏感度,能从海量数据提炼核心结果，有丰富的数据分析、挖掘、清洗和建模的经验; 
5. 有数据模型建立和运营经验、数据化运营经验、数据类产品类规划经验，尤其是互联网相关的优先;

职位描述：
1、负责微店数据仓库建设，设计、优化和落地; 
2、负责数据ETL、建模，业务数据开发和调优。
职位要求：
1、数据仓库有较扎实的理论基础，数据模型建设、应用层建设有比较丰富的经验; 
2、对自己专注的技术或业务领域有深入的理解和把握，能够有自己专注的技术长项;
3、熟练编写各类SQL，对sql有优化经验优先;
4、有Hadoop、Hive、Spark、Impala等大数据技术使用经验者优先
5、热爱大数据，性格沉稳，沟通顺畅，工作经历稳定。

岗位职责:
1. 负责分布式爬虫驱动动态网页（填表，选择，调用javascript fucntion),搜集, 提取数据，并验证数据, 持久化;
2. 负责根据新项目和产品特点需求，制定自动化测试方案，提高测试效率；
3. 负责自动测试脚本, 压力测试程序及相关配置工具的开发并执行，给出自动化测试分析报告；


任职要求:
1. 熟悉Selenium, phantomjs, scrapy等工具;
2. 熟悉Python, Javascript, CSS, HTML5, JSo, Websocket, 正则表达式, xpath;
3. 熟悉脚本编程，有自动化测试经验;
4. 熟悉MongoDB, Redis等NoSQL的优先;
5. 对新技术钻研有强烈兴趣，有良好的学习能力和强烈的进取心及创新精神。

岗位职责：
1、数据仓库（离线和实时）的设计与研发，建立体系化的数据资产；
2、对接相关业务团队进行数据梳理，清洗并协助分析完成业务数据化管理的目标；
3、对业务团队进行数据能力输出，并且负责与业务平台进行数据对接。  
 
基本条件：
1、具备较好的沟通能力、适应能力和理解能力；
2、勤奋敬业、主动性和责任心强；
3、熟悉基本的数据分析方法、数据挖掘算法；
 4、熟悉通信三大运营商业务及数据的优先考虑。    


岗位技能：
1. 从事数据仓库领域至少1年及以上，熟悉数据仓库模型设计与ETL开发经验，掌握Kimball的维度建模设计方法，具备海量数据开发和建模相关经验者优先;
2. 掌握实时数据开发的原理和技术，具有SPARK, STORM等开发经验者优先;
 3.   掌握至少一种数据库开发技术：Oracle、Hive、DB2、SQLServer、Mysql等，灵活运用SQL实现海量数据ETL加工处理;
4. 熟悉数据仓库领域知识和技能者优先，包括但不局限于：元数据管理、数据开发测试工具与方法、数据质量、主数据管理 ;
5. 熟练掌握一门或多门编程语言，并有大型项目建设经验者优先;
6. 了解数据分析和数据挖掘的相关知识，对在实际项目中使用过数据分析和挖掘相关模型经验者优先;
7. 良好的语言沟通与表达能力和自我驱动动力，优秀的学习能力，良好的心理素质和抗压能力，有良好的团队意识.

工作职能：
　　1、产品数据采集;
　　2、数据走向分析;
　　3、产品问题锁定;
　　4、提供产品部门相应解决方案。
　　任职要求：
　　知识/经验：具有数理统计，经济学，数据库原理以及相关知识;能熟练使用EXCLE、SPSS、QUANVERT、SAS等统计软件，精通SQL数据库
　　工作能力： 严谨的逻辑思维能力、学习能力、言语表达能力、管理能力。
　　工作态度：积极主动、工作认真、工作严谨。

【岗位职责】
1、负责微店数据仓库建设，设计、优化和落地; 
2、负责数据ETL、建模，业务数据开发和调优。
【职位要求】
1、数据仓库有较扎实的理论基础，数据模型建设、应用层建设有比较丰富的经验; 
2、对自己专注的技术或业务领域有深入的理解和把握，能够有自己专注的技术长项;
3、熟练编写各类SQL，对sql有优化经验优先;
4、有Hadoop、Hive、Spark、Impala等大数据技术使用经验者优先
5、热爱大数据，性格沉稳，沟通顺畅，工作经历稳定。
